svgEditor.addExtension("Hello World",function(){return{name:"Hello World",svgicons:"/assets/svg-edit-2.6/extensions/helloworld-icon.xml",buttons:[{id:"hello_world",type:"mode",title:"Say 'Hello World'",events:{click:function(){svgCanvas.setMode("hello_world")}}}],mouseDown:function(){return"hello_world"==svgCanvas.getMode()?{started:!0}:void 0},mouseUp:function(o){if("hello_world"==svgCanvas.getMode()){var e=svgCanvas.getZoom(),l=o.mouse_x/e,n=o.mouse_y/e,s="Hello World!\n\nYou clicked here: "+l+", "+n;$.alert(s)}}}});